    render() {        
        if (this.user_status === null) {
            return <Redirect to='/' />
        }
        return (
            <div>
                <Header></Header>
                <div id="wrapper">
                    <Sidebar></Sidebar>
                    <div id="content-wrapper">





                    </div>
                </div>
             </div>

        );
    }
}
